INSERT INTO `emailtemplates` (`id`, `TemplateName`, `TemplateText`, `Subject`, `SenderName`,`SenderEmail`) VALUES ('2', 'activationLink','<!DOCTYPE html> <html> <head> <link href="http://fonts.googleapis.com/css?family=Lato:400,700" rel="stylesheet" type="text/css"> <style>body {font-family: "Lato";}</style> </head> <body bgcolor= "#ebecee"> <center> <div style="width:95%; height: 10px; margin: 50px 0px 0px 0px;"> <div> <table height="100%" width="100%" cellpadding="0" cellspacing="0" border="0"> <tr> <td align="center" valign="top" height="10" bgcolor="#284e77" style="background-color:#284e77;font-size:1px;line-height:1px; -webkit-text-size-adjust:none;">&nbsp; </td> </tr> </table> </div> </div> <div style="width:95%; margin: 0px 0px 50px 0px;"> <div style="display: inline-block; text-align: left;"> <table height="100%" width="100%" cellpadding="0" cellspacing="0" border="0"> <tr> <td style="background-color:#ffffff; -webkit-text-size-adjust:none;"> <div style="margin: 50px 20px 50px 20px; color: #333b44; font-size: 14px;"> <span style="margin: 10% 0% 5% 0%;"> <table style="width: 50%;" width="50%"> <tr><td width="200"> <img width="200" src="https://www.kony.com/assets/images/all/themes/kony/assets/images/logo.svg" alt="kony_logo" style="text-align: right; width: 200px; border: 0;"> </tr> </table> </span> <br><br>Hi %firstName%,<br><br>You are invited to Digital Banking Channel. Please activate your account now.<br> <br><br>Username: %userName%<br><br> <br>You are required to input your Username in the link below.<br><br> <div float="center" style="text-align: center; border-width: 1px; border-radius: 4px;"> <table height="100%" width="100%" cellpadding="0" cellspacing="0" border="0" style="table-layout:fixed;"> <tr> <td align="center" style="color: #ffffff; background-color: #333b44; word-wrap:break-word; word-break:break-all; padding: 10px; line-height: 20px;"> <div style="margin: 10px 10px 10px 10px; font-size: 13px;"> <span>To activate your account and set a password,<a style="color: #11abeb;" href="%resetPasswordLink%">click here</a></span> <br> <span>or paste the following link on your browser:</span> <br><br><a style="color: #11abeb;" href="%resetPasswordLink%">Activate Account Link</a>	 </div></td></tr></table></div> <br><div align="center">The link will expire in 24 hours, so please use it right away.</div> <br><span>Regards,</span><br><span>Kony Banking Team</span> <br><br><br><br><span style="color: #999999; font-size: 12px;">This is a system generated mail. If you are not the named addressee please notify the sender immediately by e-mail at support@konybank.com and then delete the e-mail from your system. Although the company has taken reasonable precautions to ensure no viruses are present in this email, the company cannot accept responsibility for any loss or damage arising from the use of this email or attachments. Kony, Inc. www.kony.com </span><br><br> <div align="center"><span style="color: #999999;">Copyright &copy; 2018 Kony DBX. All rights reserved.</span></div></div></td></tr></table></div></div> </center> </body> </html>', 'Account Activation', 'kony dbx', 'retailbankingdemos@kony.com');
